func (s *trieTestSuite) TestStartsWith02() {
	s.addWord02()

	startsCases := []struct {
		arg1   string
		target bool
	}{
		{
			arg1:   "",
			target: true,
		},
		{
			arg1:   "",
			target: false,
		},
		{
			arg1:   "",
			target: true,
		},
		{
			arg1:   "a",
			target: true,
		},
	}

	for _, tc := range startsCases {
		s.Equal(tc.target, s.t.StartsWith(tc.arg1))
	}
}

